How to avoid CORS issues when connecting to MongoDB Realm GraphQL endpoint with Axios?<p>I have a test database in MongoDB Atlas. Using the MongoDB Realm service, I've been able to set up a GraphQL endpoint for the database.</p>
<p>I can run queries internally with their sandbox (GraphiQL).</p>
<p><a href="https://i.stack.imgur.com/tS4Yz.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/tS4Yz.png" alt="graphiql" /></a></p>
<p>After configuring the API key auth provider...</p>
<p><a href="https://i.stack.imgur.com/vyiqq.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/vyiqq.png" alt="api key" /></a></p>
<p><a href="https://i.stack.imgur.com/fMuiD.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/fMuiD.png" alt="allow request origins" /></a></p>
<p>...I was able to run queries externally from Postman, calling <code>https://realm.mongodb.com/api/client/v2.0/app/&lt;MY_APP_ID&gt;/graphql</code>.</p>
<p><a href="https://i.stack.imgur.com/V6YVm.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/V6YVm.png" alt="postman" /></a></p>
<p>However, trying to make the same call using axios...</p>
<pre><code>await axios({
  method: 'POST',
  url:
    'https://realm.mongodb.com/api/client/v2.0/app/&lt;MY_APP_ID&gt;/graphql',
  headers: {
    apiKey: '&lt;MY_API_KEY&gt;',
    'Content-Type': 'application/json',
  },
  data: {
    query: `
      {
        item {
          _id
          name
          description
        }
      }
    `
  }
})
</code></pre>
<p>...gives a CORS error.</p>
<p><a href="https://i.stack.imgur.com/7C7Da.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/7C7Da.png" alt="cors error" /></a></p>
<p>Is there something I need to configure in Realm or a header that I'm missing to allow external access to the GraphQL endpoint from the browser?</p>

