MongoDB Optional Partial Unique Index in Nested Arrays<p>I am trying to create a solution for a unique partial index on <code>token</code> field in a nested array <code>apps.tokens</code>, such that the nested array <code>tokens</code> is optional or can be empty.</p>
<p>I create the index as:</p>
<pre><code>collection.createIndex(
        Indexes.ascending(&quot;apps.tokens.token&quot;),
        new IndexOptions()
                .unique(true)
                .partialFilterExpression(
                        Filters.type(&quot;apps.tokens.token&quot;, BsonType.STRING)
                )
);
</code></pre>
<p>The value of the field <code>apps.tokens.token</code> is never explicitly <code>null</code> and will always be some unique string. I am currently not worried about duplicates within the same document.</p>
<p>However, I can't get the partial index to behave the way I would expect. It is mostly working as intended, except for situations when there is an item in the <code>apps</code> array with an empty or missing <code>tokens</code> array.</p>
<p>Creating the following structure fails with error <code>E11000 duplicate key error collection: db1.testCollection index: apps.tokens.token_1 dup key: { apps.tokens.token: null } </code>:</p>
<pre><code>[
    {
        &quot;apps&quot;: [
            {
                &quot;client_id&quot;: &quot;capp1&quot;,
                &quot;tokens&quot;: [
                    {
                        &quot;token&quot;: &quot;t1&quot;,
                        &quot;expiration&quot;: &quot;2020-09-10T23:31:17.119+01:00&quot;
                    }
                ]
            },
            {
                &quot;client_id&quot;: &quot;capp2&quot;
            }
        ],
        &quot;uuid&quot;: &quot;89337f58-a491-4e17-b8dd-726c9319dcaa&quot;
    },
    {
        &quot;apps&quot;: [
            {
                &quot;client_id&quot;: &quot;capp3&quot;,
                &quot;tokens&quot;: [
                    {
                        &quot;token&quot;: &quot;t2&quot;,
                        &quot;expiration&quot;: &quot;2020-09-10T23:31:17.119+01:00&quot;
                    }
                ]
            },
            {
                &quot;client_id&quot;: &quot;capp4&quot;
            }
        ],
        &quot;uuid&quot;: &quot;4ccc4d81-990f-4650-b26e-1d26fd22d91a&quot;
    }
]
</code></pre>
<p>However, this structure is perfectly valid according to the same index:</p>
<pre><code>[
    {
        &quot;apps&quot;: [
            {
                &quot;client_id&quot;: &quot;capp1&quot;
            },
            {
                &quot;client_id&quot;: &quot;capp2&quot;
            }
        ],
        &quot;uuid&quot;: &quot;89337f58-a491-4e17-b8dd-726c9319dcaa&quot;
    },
    {
        &quot;apps&quot;: [
            {
                &quot;client_id&quot;: &quot;capp3&quot;
            },
            {
                &quot;client_id&quot;: &quot;capp4&quot;
            }
        ],
        &quot;uuid&quot;: &quot;4ccc4d81-990f-4650-b26e-1d26fd22d91a&quot;
    }
]
</code></pre>
<p>My guess is that the first test case fails, because, having the first item inserted, the index checks that it has a <code>apps.token.token</code> field that is a String and adds this whole document to the insert/update comparison.</p>
<p>On the other hand, the second test case does not fail, because none of the documents match the condition of <code>apps.tokens.token</code> being a String.</p>
<p>As it looks at the second item to be inserted, it somehow deduces that it has a <code>apps.token.token</code> field that is implicitly <code>null</code> (because there is no <code>tokens</code> array in one of the <code>apps</code> items), then it checks whether the existing item matches <code>{&quot;apps.tokens.token&quot;: null}</code> and indeed it does, and ends the operation in a failure.</p>
<p>What am I doing wrong?</p>
<p>I have tried to create the partial index with <code>exists</code> filter too, but it does not help.</p>
<pre><code>Filters.and(
        Filters.type(&quot;apps.tokens.token&quot;, BsonType.STRING),
        Filters.exists(&quot;apps.tokens.token&quot;),
        Filters.exists(&quot;apps.tokens&quot;)
)
</code></pre>
<p>Is it possible to supplement the filter with some sort of function that will handle cases when <code>tokens</code> does not exist or is empty for each <code>apps</code> item in a document?</p>

