Refactoring RESTful API into smaller functions<p><strong>Background</strong></p>
<p>I have a NodeJS app that is meant to be used as a RESTful API. It is connected with a MongoDB database in the backend using Mongoose. The app is built upon the idea of nested documents. It stores <code>wikis</code>, <code>sections</code> and <code>notes</code> with the following schema:</p>
<pre><code>const noteSchema = new mongoose.Schema({ title: String, content: String });
const sectionSchema = new mongoose.Schema({ title: String, notes: [noteSchema] });
const wikiSchema = new mongoose.Schema({ title: String, sections: [sectionSchema] });
</code></pre>
<p>All of which are accessed via a single model of the wiki:</p>
<pre><code>const wikiModel = mongoose.model(&quot;Wiki&quot;, wikiSchema);
</code></pre>
<p>A user can do GET, POST, PUT, DELETE requests on each of the endpoints to manipulate the data inside. If someone wants to ping the Notes endpoint (the furthest down in the hierarchy), it must first check the wiki and then the section endpoint, to ensure that each of them exists.</p>
<p>Here's an example:</p>
<pre><code>app.get('/:wikiTitle/:sectionTitle/:noteTitle', function(req, res) {
  wikiModel.findOne({ title: req.params.wikiTitle }, function(err, wiki) {
    if (err) {
      res.send('\nAn unkown error has occured');
      console.error(err);
    } else if (wiki) {
      const sectionTitle = req.params.sectionTitle;

      wikiModel.findOne({ 'sections.title': sectionTitle }, function(err, section) {
        if (err) {
          res.send('\nAn unkown error has occured');
          console.error(err);
        } else if (section) {
            const noteTitle = req.params.noteTitle;

            wikiModel.findOne({ 'sections.notes.title': noteTitle }, function(err, n) {
              if (err) {
                res.send('\nAn unkown error has occured');
                console.error(err);
              } else if (n) {
                const section = n.sections.find((s) =&gt; { return s.title === sectionTitle; });
                const note = section.notes.find((n) =&gt; { return n.title === noteTitle; });

                if (note.content) {
                  res.send('\n' + note.title + '\n\n' + note.content);
                } else {
                  res.send('\n' + note.title + '\n\n[ No content to show ]');
                }
              } else {
                res.send('\nNo such note exists');
              }
            });
        } else {
          res.send('\nNo such section exists');
        }
      });
    } else {
      res.send('\nNo such wiki exists');
    }
  });
});
</code></pre>
<p>This is a very lengthy method and the first two queries are actually frequently throughout the app. I also understand a MongoDB query is an asynchronous operation and thus, why I put each consequent MongoDB query within it's parent (the one I wish to finish before that one begins).</p>
<p><strong>Question</strong></p>
<p>Is there a way to split each MongoDB query into its own method or introduce promises in a way that would shorten the code? I would rather prefer advice that ultimately causes the splitting of my code into individual methods as what you see above is one of many endpoints which all use the same queries.</p>
<p>So in the end result I would like to have something close to the likes of:</p>
<pre><code>app.get('/:wikiTitle/:sectionTitle/:noteTitle', function(req, res) {
  if (getWiki(req.params.wikiTitle)) {
    // Continue with second query
    if (getSection(req.params.sectionTitle)) {
      // Continue with third query...
    }
  }
});

function getWiki(wikiTitle) {
  wikiModel.findOne({ title: wikiTitle }, function(err, wiki) {
    if (err) {
      console.error(err);
      res.send('An unknown error occured.');
    } else if (wiki) {
      // Send OK result to continue to next query
      return wiki
    } else {
      res.send('No wiki found');
      return null;
    }
  });
}

function getSection(sectionTitle) {
  wikiModel.findOne({ 'sections.title': sectionTitle }, function(err, section) {
    if (err) {
      console.error(err);
      res.send('An unknown error occured.');
    } else if (section) {
      // Send OK result to continue to next query
      return section
    } else {
      res.send('No section found');
      return null;
    }
  });
}
</code></pre>
<p>I am hoping this will significantly cut the length of code and also utilise re-usability of code. Any advice on how I could come close to achieving something like this is welcome.</p>

